void OAIPlayersApi::pOSTPlayersPlayerIdLogo(const QString &player_id, const OAIHttpFileElement &file, const QString &link) {
    QString fullPath = QString(_serverConfigs["pOSTPlayersPlayerIdLogo"][_serverIndices.value("pOSTPlayersPlayerIdLogo")].URL()+"/players/{playerId}/logo");
    
    if (!_bearerToken.isEmpty())
        addHeaders("Authorization", "Bearer " + _bearerToken);
    
    
    {
        QString player_idPathParam("{");
        player_idPathParam.append("playerId").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "playerId", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"playerId"+pathSuffix : pathPrefix;
        fullPath.replace(player_idPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(player_id)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    
    {
        input.add_file("file", file.local_filename, file.request_filename, file.mime_type);
    }
    
    {
        input.add_var("link", ::OpenAPI::toStringValue(link));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIPlayersApi::pOSTPlayersPlayerIdLogoCallback);
    connect(this, &OAIPlayersApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

